import LoggedFilm from "./components/LoggedFilm";

function App() {
  const logList = [
    {
      id: 'f1',
      title: 'Jaws',
      rating: '5',
      date: new Date(2023, 1, 1)
    },
    {
      id: 'f2',
      title: 'The Texas Chainsaw Massacre',
      rating: '5',
      date: new Date(2023, 1, 2)
    },
    {
      id: 'f3',
      title: '2 Fast 2 Furious',
      rating: '2',
      date: new Date(2023, 1, 3)
    },
    {
      id: 'f4',
      title: 'Jay and Silent Bob Strike Back',
      rating: '3',
      date: new Date(2023, 1, 4)
    },
  ]

  return (
    <div>
      <h2>Let's get started!</h2>
      <LoggedFilm
        title={logList[0].title}
        rating={logList[0].rating}
        date={logList[0].date}
      />
      <LoggedFilm
        title={logList[1].title}
        rating={logList[1].rating}
        date={logList[1].date}
        />
      <LoggedFilm
        title={logList[2].title}
        rating={logList[2].rating}
        date={logList[2].date}
        />
      <LoggedFilm
        title={logList[3].title}
        rating={logList[3].rating}
        date={logList[3].date}
        />
    </div>
  );
}

export default App;
